import React from "react";
import {
  FooterContainer,
  FooterNavList,
  FooterNavLink,
  FooterTradeMark,
  FooterSocials,
  FooterSocialsItem,
} from "./FooterElements";
import { BiWorld } from "react-icons/bi";
import {
  AiOutlineTwitter,
  AiFillFacebook,
  AiFillInstagram,
} from "react-icons/ai";
import { FaPinterestP } from "react-icons/fa";

const Footer = () => {
  return (
    <FooterContainer>
      <FooterNavList>
        <FooterNavLink>Home</FooterNavLink>
        <FooterNavLink>Search</FooterNavLink>
        <FooterNavLink>About</FooterNavLink>
      </FooterNavList>
      <FooterTradeMark>Â© Carlito Jr Dela Pena</FooterTradeMark>
      <FooterSocials>
        <FooterSocialsItem>
          <BiWorld />
        </FooterSocialsItem>
        <FooterSocialsItem>
          <AiOutlineTwitter />
        </FooterSocialsItem>
        <FooterSocialsItem>
          <BiWorld />
        </FooterSocialsItem>
        <FooterSocialsItem>
          <AiFillFacebook />
        </FooterSocialsItem>
        <FooterSocialsItem>
          <AiFillInstagram />
        </FooterSocialsItem>
        <FooterSocialsItem>
          <FaPinterestP />
        </FooterSocialsItem>
      </FooterSocials>
    </FooterContainer>
  );
};

export default Footer;
